// Functions
export function composeMakefile(): string {
	return `
#---------------------------------------------------------------------------------
.SUFFIXES:
#---------------------------------------------------------------------------------

ifeq ($(strip $(MintPath)),)
$(error "Please set Mint's path in your environment. export MintPath=<mintc-exe-directory>")
endif

.PHONY: mintbuild

mintbuild:
	@$(MintPath)/mint compile
`.substring(1);
}

export function composeBase(): string {
	return `
// Mint JavaScript source

// Inizialice console
console.init();
console.println("Hello Switch, from Mint, Mint/Cli & JavaScript!");

// Infinite loop
while(true) {
	// To do here
}

// Close console
console.exit();
	`.substring(1);
}

export function composeProjectProperties(name: string, author: string, version: string, assets: string, type: number): string {
	return `
{
	"Name": "${name}",
	"Author": "${author}",
	"Version": "${version}",
	"Icon": "icon.png",
	"AssetsDir": "${assets}",
	"ProjectType": ${type}
}
	`.substring(1);
}

export function composeBase64() {
	let image = "data:image/jpeg;base64,";
	return image.split(';base64,').pop();
}